  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:11.063151\",\n\t\"name\": \"lacreek-national-wildlife-refuge-annual-narrative-report-calendar-year-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lacreek
  National Wildlife Refuge outlines Refuge accomplishments during the 2001 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master planning, public
  participation, compliance with environmental mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
  management, pest control, water rights, WPA easement monitoring, and private lands.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, other
  resident wildlife, marking and banding, and disease prevention and control. The
  public uses of the Refuge described in this report include interpretive programs,
  hunting, fishing, trapping, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment utilization and replacement, communication systems, and computer
  systems. Items of interest are provided at the end.\",\n\t\"license_title\": \"License
